    'about.AboutBrand': 'OLX \u0915\u0947 \u092C\u093E\u0930\u0947 \u092E\u0947\u0902',
    'about.AboutText1': 'OLX \u0926\u0941\u0928\u093F\u092F\u093E \u0915\u093E \u0905\u0917\u094D\u0930\u0923\u0940 \u0935\u0930\u094D\u0917\u0940\u0915\u0943\u0924 \u092E\u0902\u091A \u0939\u0948 \u0909\u092D\u0930\u0924\u0947 \u092C\u093E\u091C\u093C\u093E\u0930\u094B\u0902 \u092A\u0930 \u0927\u094D\u092F\u093E\u0928 \u0915\u0947\u0902\u0926\u094D\u0930\u093F\u0924 \u0930\u0916\u0924\u093E \u0939\u0948\u0964 \u0907\u0928\u092E\u0947\u0902 \u0926\u094B\u0928\u094B\u0902 \u092E\u094B\u092C\u093E\u0907\u0932 \u0914\u0930 \u0911\u0928\u0932\u093E\u0907\u0928 \u092C\u093E\u091C\u093C\u093E\u0930 \u0936\u093E\u092E\u093F\u0932 \u0939\u0948\u0902',
    'about.AboutText2': 'OLX \u0935\u093F\u0936\u094D\u0935 \u092D\u0930 \u092E\u0947\u0902 \u0915\u093E\u0930\u094B\u092C\u093E\u0930 \u0915\u0930\u0924\u093E \u0939\u0948 \u0914\u0930 \u0935\u0939 40 \u0938\u0947 \u0905\u0927\u093F\u0915 \u0926\u0947\u0936\u094B\u0902 \u092E\u0947\u0902 \u092E\u094C\u091C\u0942\u0926 \u0939\u0948',
    'about.about_Body': '<p>OLX \u0905\u0917\u0932\u0940 \u092A\u0940\u0922\u093C\u0940 \u0915\u093E \u0928\u093F\u0936\u094D\u0936\u0941\u0932\u094D\u0915, \u0913\u0928\u0932\u093E\u0907\u0928 \u0935\u0930\u094D\u0917\u0940\u0915\u0943\u0924 \u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928 \u0938\u093E\u0907\u091F \u0939\u0948\u0964<br /><br />OLX \u092C\u093F\u0915\u094D\u0930\u0940, \u0916\u0930\u0940\u0926\u093E\u0930\u0940, \u0905\u0926\u0932\u093E-\u092C\u0926\u0932\u0940, \u0935\u093E\u0930\u094D\u0924\u093E\u0932\u093E\u092A, \u0938\u092E\u093E\u092F\u094B\u091C\u0928 \u0914\u0930 \u0906\u092A\u0915\u0947 \u0906\u0938\u092A\u093E\u0938 \u0915\u0947 \u0932\u094B\u0917\u094B\u0902 \u0938\u0947 \u092E\u0941\u0932\u093E\u0915\u093E\u0924 \u092E\u0947\u0902 \u0906\u0928\u0947\u0935\u093E\u0932\u0940 \u0938\u092E\u0938\u094D\u092F\u093E\u0913\u0902 \u0915\u093E \u090F\u0915 \u0938\u0930\u0932 \u0938\u092E\u093E\u0927\u093E\u0928 \u092A\u094D\u0930\u0938\u094D\u0924\u0941\u0924 \u0915\u0930\u0924\u093E \u0939\u0948\u0964 \u0906\u092A \u091C\u0939\u093E\u0901 \u092D\u0940 \u0930\u0939\u0924\u0947 \u0939\u094B\u0902, \u092F\u0939 \u0906\u092A\u0915\u0947 \u0932\u093F\u090F \u0909\u092A\u092F\u094B\u0917\u0940 \u0939\u0948\u0964 <br /><br />OLX \u092E\u0947\u0902 \u0906\u092A \u092F\u0939 \u0938\u092C \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902:<br /><ul><li>\u0938\u0930\u0932\u0924\u093E \u0938\u0947 \u0905\u092A\u0928\u0940 \u0938\u093E\u092E\u0917\u094D\u0930\u0940 \u0915\u093E \u091A\u093F\u0924\u094D\u0930\u094B\u0902 \u0914\u0930 \u0935\u0940\u0921\u093F\u092F\u094B \u0938\u0939\u093F\u0924 \u0930\u0902\u0917\u0940\u0928 \u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928 \u092C\u0928\u093E\u0928\u093E </li><li>\u0905\u092A\u0928\u0940 \u092C\u093F\u0915\u094D\u0930\u0940, \u0916\u0930\u0940\u0926\u093E\u0930\u0940 \u0914\u0930 \u0938\u093E\u092E\u0941\u0926\u093E\u092F\u093F\u0915 \u0917\u0924\u093F\u0935\u093F\u0927\u093F\u092F\u094B\u0902 \u0915\u094B \u092E\u0947\u0930\u093E OLX \u0915\u0947 \u091C\u0930\u093F\u090F \u0928\u093F\u092F\u0902\u0924\u094D\u0930\u0923</li><li>\u0905\u092A\u0928\u0947 \u0935\u093F\u091C\u094D\u091E\u093E\u092A\u0928 \u0915\u094B \u0905\u092A\u0928\u0940 \u0938\u093E\u092E\u093E\u091C\u093F\u0915 \u0928\u0947\u091F\u0935\u0930\u094D\u0915\u093F\u0902\u0917 \u092A\u094D\u0930\u094B\u092B\u093C\u093E\u0907\u0932 (Facebook, \u092E\u093E\u0908\u0938\u094D\u092A\u0947\u0938, ...) \u0906\u0926\u093F \u092E\u0947\u0902 \u0926\u0930\u094D\u0936\u093E\u0928\u093E</li><li>\u0905\u092A\u0928\u0947 \u092E\u094B\u092C\u093E\u0907\u0932 \u092B\u093C\u094B\u0928 \u0938\u0947 \u0907\u0938 \u0938\u094D\u0925\u0932 \u0924\u0915 \u092A\u0939\u0941\u0901\u091A\u0928\u093E </li><li>OLX \u0915\u094B \u0905\u092A\u0928\u0940 \u092D\u093E\u0937\u093E \u092E\u0947\u0902 \u0926\u0947\u0916\u0928\u093E</li></ul><br />OLX \u0915\u093E \u0909\u092A\u092F\u094B\u0917 <<QTY_COUNTRIES>> \u0926\u0947\u0936\u094B\u0902 \u092E\u0947\u0902 <<QTY_LANGUAGES>> \u092D\u093E\u0937\u093E\u0913\u0902 \u092E\u0947\u0902 \u0939\u094B \u0930\u0939\u093E \u0939\u0948\u0964 \u0907\u0938 \u0915\u0902\u092A\u0928\u0940 \u0915\u0940 \u0938\u094D\u0925\u093E\u092A\u0928\u093E \u092E\u093E\u0930\u094D\u091A 2006 \u092E\u0947\u0902 \u0939\u0941\u0908\u0964 \u092F\u0939 \u090F\u0915 \u0928\u093F\u091C\u0940 \u0915\u0902\u092A\u0928\u0940 \u0939\u0948\u0964 </p>',
